import { isEmpty } from "lodash"
import { useRouter } from "next/router"
import { useState, useEffect } from "react"
import { Dashboard } from "../components"
import firebase from "firebase/app"
import initialFirebase from "../public/firebase"
import "firebase/firestore"

export default function Home() {
  const router = useRouter()
  const [dataFirestore, setDataFirestro] = useState([])

  useEffect(() => {
    if (isEmpty(window.localStorage.getItem('isToken'))) {
      router.push('/login')
    } else {
      initialFirebase()
      const db = firebase.firestore()

      db.collection('cars').get().then((snapshot) => {
        snapshot.forEach(doc => {
          setDataFirestro(dataFirestore.push(doc.data()))
        })
      })
    }
  })

  return (
    <Dashboard dataFirestore={console.log(dataFirestore)}/>
  )
}
